INSERT INTO `plotsystem_reviews` VALUES (1,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','Top :)','2021-09-27 00:00:00',1),(2,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','4,4,5,5','Die Dachfarbe ist meiner Meinung nach etwas zu Dunkel. Ich würde da eher//eine Mischung aus Terracotta und Orange Terracotta empfehlen :)','2021-09-27 00:00:00',1),(3,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','3,3,3,3','Nur 12 Punkte aufgrund der Schwierigkeit. So ein Gebäude wäre//nicht im PlotSystem. :)','2021-09-27 00:00:00',1),(4,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,4,5','Dachdetails fehlen leider','2021-09-27 00:00:00',1),(5,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','No Feedback','2021-09-27 00:00:00',1),(6,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','No Feedback','2021-09-27 00:00:00',1),(7,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','Vielleicht Shulkerboxen bei Fassaden vermeiden, weil die sonst von//weiter weg einfach verschwinden','2021-09-27 00:00:00',1),(8,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','3,2,1,3','Für die Fassade und das Dach würde ich random blocks empfehlen,//mehr Details (z.B. am Dach oder an den Fenster) würde das ganze gleich//besser wirken lassen :)','2021-09-27 00:00:00',1),(9,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,4,4,4','Bei der weissen Fassade würde ich random blocks empfehlen; Ein oberes//wurde von innen nicht zugebaut','2021-09-27 00:00:00',1),(10,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','2,3,3,3','Das Gebäude hat nicht auf allen Seiten die gleiche Fassade;//Dachfenster fehlt','2021-09-27 00:00:00',1),(11,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','No Feedback','2021-09-27 00:00:00',1),(12,'3de74dee-28f1-47dc-b428-a57bf6202573','5,5,5,5','test','2021-09-27 00:00:00',1),(13,'3de74dee-28f1-47dc-b428-a57bf6202573','5,5,5,5','No Feedback','2021-09-27 00:00:00',1),(14,'98d12492-75ff-48ab-9b3c-df5a44cd2cbc','5,5,4,4','Eigentlich alles supa ^^','2021-09-27 00:00:00',1),(15,'98d12492-75ff-48ab-9b3c-df5a44cd2cbc','3,2,2,2','No Feedback','2021-09-27 00:00:00',1),(16,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,3,4,4','Bei der Fassade würde ich random blocks empfehlen und normales Glas//würde ich mit light gray glas ersetzen. Die Textur von normalen Glas passt//grundsätzlichnicht für BTE.','2021-09-27 00:00:00',1),(17,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','4,3,3,4','Anstatt vollen Glasblöcken würde ich glas panes empfehlen. Die//Dachfenster sind nicht ganz akkurat.','2021-09-27 00:00:00',1),(18,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','No Feedback','2021-09-27 00:00:00',1),(19,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','3,4,4,4','Anstatt von normalen Glas würde ich glas panes empfehlen. Die Höhe vom//Gebäude stimmt um 2-3 Blöcke nicht :/','2021-09-27 00:00:00',1),(20,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','Top','2021-09-27 00:00:00',1),(21,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,4,4,5','Es fehlen ein paar wenige Dachdetails. Für das Dach würde ich random//blocks empfehlen.','2021-09-27 00:00:00',1),(22,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,4,5,5','An der Fassade würde ich random blocks empfehlen.','2021-09-27 00:00:00',1),(23,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,5,5,5','Nice','2021-09-27 00:00:00',1),(24,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','5,4,5,5','Anstatt nur light gray concrete powder würde ich z.B. eine Mischung aus//light gray wool und powder empfehlen. Sonst ist es top! :)','2021-09-27 00:00:00',1),(25,'3b350308-d857-4ecc-8b71-c93a2cf3c87b','4,3,4,4','Beim Dach würde ich anstatt stone bricks eher eine Mischung aus light//gray blocks empfehlen. Sonst schöne details mit den Quarzstufen und eine//guteBlockwahl. :)','2021-09-27 00:00:00',0),(26,'3de74dee-28f1-47dc-b428-a57bf6202573','5,5,4,5','Great plot but I would have liked detailing on the balcony.','2021-09-27 00:00:00',1),(27,'55e7ef0c-fe4f-4824-8315-5454a8e7f2bc','5,5,5,5','Super Plot!','2021-09-27 00:00:00',1),(28,'55e7ef0c-fe4f-4824-8315-5454a8e7f2bc','5,5,5,5','No Feedback','2021-09-27 00:00:00',1),(29,'55e7ef0c-fe4